            <video src="/Videos/Fuego_de_Refineria.mp4"></video>
            {/* <h1>{t("welcome_message")}</h1>
            CONTACT */}
            <div className="container">
                <div className="row">
                    <div className="left-img col-lg-6 col-md-6 col-12">
                        <img src="" alt="" />
                    </div>
                    <div className="right-form col-lg-6 col-md-6 col-12">

                    </div>
                </div>
            </div>
        </div>
    )
}
